### YamlMime:QSharpType
uid: microsoft.quantum.logical.notequall
name: NotEqualL
type: function
namespace: Microsoft.Quantum.Logical
summary: Returnerar true om och endast om två indata är inte lika.
remarks: >-
  Följande är likvärdiga:


  ```Q#

  let cond = a != b;

  let cond = NotEqualL(a, b);

  ```
syntax: 'function NotEqualL (a : BigInt, b : BigInt) : Bool'
input:
  content: '(a : BigInt, b : BigInt)'
  types:
  - name: a
    summary: Det första värdet som ska jämföras.
    isPrimitive: true
    uid: BigInt
  - name: b
    summary: Det andra värdet som ska jämföras.
    isPrimitive: true
    uid: BigInt
output:
  content: Bool
  types:
  - summary: '`true` om och endast om `a` inte är lika med `b`.'
    isPrimitive: true
    uid: Bool
